import React from 'react';

const Card = ({img, name, content, price, link}) => {
  return (
    <div className="card">
      <img src="test.png" />
      <h2 className="name">Продвижение веб-сайта в ТОП10</h2>
      <div className="content">
        Рекомендуем данный тариф всем типам сайтов, кроме интернет-магазинов. А интернет-магазинам
        рекомендуем продвижение по трафику.
      </div>
      <div className="subtitle">от 100 000 Р</div>
      <a>Перейти</a>
    </div>
  );
};

export default Card;
